nexusDescription="[left]Magical Blackreach is a mod that transform the otherwise quite barren cavern of blackreach into a lush and mysterious forest. Now with pine trees, even more mushrooms and covered in moss. \n<br />\n<br />Little is known of blackreach, so for all we know, maybe it was an underground forest?\n<br />\n<br /> Other Changes:\n<br />[list]\n<br />[*]Made crimson nirnroot much more available, and thus the quest Return to Your Roots much easier and faster to complete.\xa0\n<br />[*]More interesting and challenging terrain with added flora and fauna from the DLCs\n<br />[*]Modified, darker weather\xa0\n<br />[/list][b]\n<br />[INSTALLATION][/b]\n<br />With mod manager: Download\xa0 with mod manager and activate.\n<br />\n<br />Manual: Download manually, open archive and drag and drop files into skyrim special edition Data folder.\xa0\xa0\n<br />\n<br />[b]Now available to download on Xbox One through the [url=https://bethesda.net/en/mods/skyrim/mod-detail/4242331]bethesda.net[/url]\xfeff store! [/b]Thanks to\xa0PeaceoftheWorld(RlordumX)\xa0\n<br />\n<br />[[b]COMPATIBILITY LIST][/b]\n<br />[list]\n<br />[*]ELFX - conflicts, you will see lightsources and effects in odd places or slightly skewed from their source.\n<br />[*]Other blackreach landscape mods - conflicts massively, pick one.\xa0\n<br />[*]Blackreach Railroad - Compatible with [url=https://www.nexusmods.com/skyrimspecialedition/mods/45304]patch\xa0[/url]\xfeff\n<br />[/list]\xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0[list]\n<br />[/list][b][SUGGESTED MODS][/b]\n<br />[list]\n<br />[*][url=https://www.nexusmods.com/skyrimspecialedition/mods/43083]Blackreach Tentacle Mesh Fix[/url]\n<br />[*][url=https://www.nexusmods.com/skyrimspecialedition/mods/29179]Rally's Blackreach Mushrooms[/url]\n<br />[*][url=https://www.nexusmods.com/skyrimspecialedition/mods/38371?tab=description]Skyrim Remastered - Azura and Blackreach Crystals[/url]\n<br />[*][url=https://www.nexusmods.com/skyrimspecialedition/mods/46507]Dwemer Pipework Reworked[/url]\n<br />[*][url=https://www.nexusmods.com/skyrimspecialedition/mods/47802]Dwemer Tech Glowmapped[/url]\n<br />[*][url=https://www.nexusmods.com/skyrimspecialedition/mods/2154]Skyrim Flora Overhaul SE[/url]\xfeff\xfeff\xfeff\xfeff\xfeff\xfeff\n<br />[/list]These are not in order, they are all highly recommended for an even better blackreach experience!\n<br />\n<br />\n<br />[b][FUTURE DEVELOPMENT][/b]\n<br />The mod is still in development so I'm open and appreciative to suggestions and criticisms, and I have some ideas of my own to implement in the future.\xa0\n<br />Things I want to implement into the mod in the future:\n<br />[list]\n<br />[*]flora and fauna from the dawnguard DLC (have started adding them so some can be seen around blackreach already)\n<br />[*]an expanded and more detailed dwemer city overtaken and inhabited by falmer for millenia\n<br />[*]new caves and areas to explore, with lava assets but that's wishful thinking.\n<br />[*]a retexture of the trees that will replace the current ones, making it look like the spores and the magical nature of Blackreach has affected and changed them.\n<br />[*]implementing some of the mushroom creatures from\xa0[url=https://www.nexusmods.com/skyrimspecialedition/mods/6069]this mod[/url].\n<br />[*]A vampire hideout where they have been able to flourish away from the dangers of the sun and vampire hunters, but in an ongoing bloody battle with the falmer.\n<br />[/list]\n<br />\n<br />\xa0\xfeff\xfeff(Visit my\xa0 [url=https://ko-fi.com/thea_opes]ko-fi[/url]\xfeff account to see screenshots from the projects I'm working on!)\xfeff[list]\n<br />[/list]You can also donate to my patreon [url=https://www.patreon.com/Thea0pes]here[/url].\n<br />\n<br />\xfeff\x43heck out my other mod:\n<br />[url=https://www.nexusmods.com/skyrimspecialedition/mods/38390][img]data:image/jpeg;base64,[/img][/url]\xfeff\n<br />\n<br />\n<br />Thank you.\n<br />[/left]"
